import React from 'react'; 

class List extends Component {
    constructor (props){
        super(props);
    }
    render() {

        const messages = this.props.messages.map (message => (
            <li>{message.title}</li>
        ));

        return (
            <div className = "ListDiv">
                <ul>
                    {messages}
                </ul>
            </div>
        );
    }
}

export default List;
